import React from "react";
import { Link, useRouteMatch } from "react-router-dom";

function PostItem({ post }) {
  const { url } = useRouteMatch();
  return (
    <div>
      <Link to={`${url}/post/${post.id}`}>{post.title}</Link>
      <span>{post.date}</span>
    </div>
  );
}

export default PostItem;
